  true,\n\t\"url\": null,\n\t\"notes\": \"<p>CMS has been conducting real-time claims
  analysis to monitor health status for groups of Medicare beneficiaries in competitive
  bidding areas (CBAs). Health status monitoring results are shown in files updated
  on a quarterly basis. On May 17, 2016, we posted monitoring data that shows our
  efforts have saved the Medicare program money while continuing to ensure access
  to equipment for all who need it in the non-competitive bidding areas. Specifically
  that data showed that suppliers in non-competitive bidding areas have continued
  to accept the new, adjusted DMEPOS payments.<br />nAt the time that we posted the
  data on acceptance of the new, adjusted rates, we indicated that we would soon be
  furnishing monitoring data on health outcomes for beneficiaries in non-competitive
  bidding areas.  The health outcomes monitoring data are now available.</p>n\",\n\t\"license_title\":
